import React, { Component } from "react";

class Agradecimentos extends Component {
  render() {
    return (
      <div className="Agradecimentos">
        <div class="ag_structure">
          <h1 className="title">Agradecimentos</h1>
          <p className="p-1">
            As borboletas monarca (Danaus plexippus) pertencem à ordem
            Lepidoptera e à classe Insecta, dando título a este espetáculo. A
            vida destas borboletas pode ser extremamente curta, durante apenas
            poucas semanas, mas durante este curto período sofrem uma
            metamorfose extraordinária e efetuam uma das grandes e mais notáveis
            migrações de toda a classe dos insetos. Para isto, apresentam um
            excelente sentido de orientação que é comparado a um compasso
            natural, auxiliando as borboletas na sua migração.
          </p>
        </div>
      </div>
    );
  }
}

export default Agradecimentos;
